import { Col, Empty, Row } from 'antd';
import React, { useEffect } from 'react';
import InfiniteScroll from 'react-infinite-scroller';
import { Loading } from '../../../../components';
import { useOrders } from '../../pages/order/state';
import './order-list.less';
import OrderRow from './order-row';
// import { Scrollbars } from 'react-custom-scrollbars';
// import Scrollbars from 'react-custom-scrollbars';
import { Scrollbars } from 'react-custom-scrollbars';



interface Props {}

const LIMIT = 20;

const OrdersList = (props: Props) => {
    const { orders, setLoading, getOrders, loading, selectOrder, total, page, setPage } =
        useOrders();

    const loadMore = (numberPage: number) => {
        if (Math.ceil(total / LIMIT) >= numberPage) {
            setPage(numberPage);
        }
    };

    useEffect(() => {
        setLoading();
        getOrders({});
        // eslint-disable-next-line react-hooks/exhaustive-deps
    }, []);

    const handleUpdate = () => {
        //this.scrollbar.scrollToBottom();
    };




    const renderListOrder = () => {
        if (loading) return <Loading />;

        if (orders.length === 0)
            return (
                <Empty image={Empty.PRESENTED_IMAGE_SIMPLE} description='Không tìm thấy đơn hàng' />
            );

        return (
            <Scrollbars
                // pageStart={1}
                // loadMore={loadMore}
                // hasMore={Math.ceil(total / LIMIT) > page}
                // useWindow={false}
                // initialLoad={false}
                // isReverse={false}
                // threshold={10}
                style={{ width: '100%', height: '100%' }}
                onUpdate={() => handleUpdate()}
                // renderThumbVertical={(props) => <Thumb {...props} />}
                // autoHide
                autoHideTimeout={1000}
                autoHideDuration={200}
                renderer={(props:any) => {
                    const { elementRef, ...restProps } = props;
                    return (
                        <span
                            {...restProps}
                            ref={elementRef}
                            className='MyAwesomeScrollbarsHolder'
                        />
                    );
                }}
                wrapperProps={{
                    renderer: (props) => {
                        const { elementRef, ...restProps } = props;
                        return (
                            <span
                                {...restProps}
                                ref={elementRef}
                                className='MyAwesomeScrollbarsWrapper'
                            />
                        );
                    },
                }}
                scrollerProps={{
                    renderer: (props) => {
                        const { elementRef, ...restProps } = props;
                        return (
                            <span
                                {...restProps}
                                ref={elementRef}
                                className='MyAwesomeScrollbarsScroller'
                            />
                        );
                    },
                }}
                contentProps={{
                    renderer: (props) => {
                        const { elementRef, ...restProps } = props;
                        return <span {...restProps} ref={elementRef} className='Content' />;
                    },
                }}
                trackXProps={{
                    renderer: (props) => {
                        const { elementRef, ...restProps } = props;
                        return <span {...restProps} ref={elementRef} className='TrackX' />;
                    },
                }}
                trackYProps={{
                    renderer: (props) => {
                        const { elementRef, ...restProps } = props;
                        return <span {...restProps} ref={elementRef} className='trackY' />;
                    },
                }}
                thumbXProps={{
                    renderer: (props) => {
                        const { elementRef, ...restProps } = props;
                        return <span {...restProps} ref={elementRef} className='ThUmBX' />;
                    },
                }}
                thumbYProps={{
                    renderer: (props:any) => {
                        const { elementRef, ...restProps } = props;
                        return <span {...restProps} ref={elementRef} className='tHuMbY' />;
                    },
                }}
            >
                {orders.map((order: any, index: number) => (
                    <OrderRow
                        selectOrder={selectOrder}
                        order={order}
                        key={order._id}
                        isDark={index % 2 === 0}
                    />
                ))}

                {loading && <Loading />}
            </Scrollbars>
        );
    };


    return (
        <div className='order-list card-shadow'>
            <Row className='order-list-heading'>
                <Col className='order-code'>Mã đơn hàng</Col>
                <Col className='order-status' style={{ textAlign: 'center' }}>
                    Trạng thái
                </Col>
                <Col className='paid-status' style={{ textAlign: 'center' }}>
                    Trạng thái thanh toán
                </Col>
                <Col className='order-price' style={{ textAlign: 'right' }} flex={3}>
                    Tổng giá
                </Col>
            </Row>

            <div className='order-list-body' style={{ flex: 1 }}>
                {renderListOrder()}
            </div>
        </div>
    );
};

export default OrdersList;
